const mongoose = require("mongoose");

const Schema = mongoose.Schema;

const userSchema = new Schema({
    username: {
        type: String,
        // unique: true,
        required: true,
    },
    name: {
        type: String,
        required: true,
    },
    surname: String,

    password: {
        type: String,
        required: true,
    },
    email: {
        type: String,
    },
    role: {
        type: Array,
        default: "User",
        required: true,
    },
    birthday: Date,

    registeredAt: {
        type: Date,
        default: () => Date.now(),
        immutable: true,
    },
    avatar: {
        type: String,
        default: defaultAvatar,
    },

    comments: {
        type: Number,
        default: 0,
    },
    reviews: {
        type: Number,
        default: 0,
    },
    reviewedRestaurants: {
        type: Array,
    },
    favouriteRestaurants: [],
    ratedComments: [],
    rating: Number,
    bloger: {
        type: Boolean,
        default: false,
    },
    blogData: {
        type: Object,
        default: null,
    },
    // blogData: {
    //     blogerName: String,
    //     blogPosts: Array,
    //     blogPostsCount: Number,
    //     blogerRating: Number,
    //     aboutMe: String,
    //     blogAvatar: String,
    //     blogCity: String,
    // },
});
function defaultAvatar() {
    return "data:image/jpeg;base64,";
}
const User = mongoose.model("User", userSchema);

module.exports = User;
